<?phpnamespace Nemundo\Meteo\Kachelmann\Data\Satellitenbilder;class SatellitenbilderPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var SatellitenbilderModel*/public $model;public function __construct() {parent::__construct();$this->model = new SatellitenbilderModel();}/*** @return SatellitenbilderRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new SatellitenbilderRow($dataRow, $this->model);$list[] = $row;}return $list;}}